import React from 'react';
import { render } from 'react-dom';

type OrganismProps = {
    organismName: string,
    isSelected: boolean,
}
export default class Organism extends React.Component<{}, any> {
    constructor(props:any) {
        super(props);
        this.state = {
            organismName: '',
            isSelected: false,
        };
    }
    removeOrganism ()  {
        console.log('! ! ! remove organism called');
    }

    organismName (event:any) {
        console.log('! ! ! organismName called:', JSON.stringify(event, null, 2));
    }

    render( props:OrganismProps ){
        return (
            <div className='organism'>
                <p>here's an organism</p>
                {this.props.organismName}<button className='remove' onClick={this.removeOrganism}>-</button>
            </div>

        )
    }
}
